// src/pages/Facturas.jsx
import { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

export default function Facturas() {
  const [facturas, setFacturas] = useState([]);
  const [rutBusqueda, setRutBusqueda] = useState('');
  const [proveedores, setProveedores] = useState([]);
  const [proveedorSeleccionado, setProveedorSeleccionado] = useState('');
  const [fechaInicio, setFechaInicio] = useState('');
  const [fechaFin, setFechaFin] = useState('');

  const fetchFacturas = async () => {
    try {
      const params = {};
      if (rutBusqueda) params.rut = rutBusqueda;
      if (proveedorSeleccionado) params.rut = proveedorSeleccionado;
      const res = await axios.get('http://localhost:8001/facturas/buscar', { params });
      setFacturas(res.data);
    } catch (err) {
      console.error('Error al buscar facturas', err);
    }
  };

  const fetchProveedores = async () => {
    const res = await axios.get('http://localhost:8001/proveedores');
    setProveedores(res.data);
  };

  useEffect(() => {
    fetchFacturas();
    fetchProveedores();
  }, []);

  const handleBuscar = (e) => {
    e.preventDefault();
    fetchFacturas();
  };

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4">Facturas</h1>

      <form onSubmit={handleBuscar} className="mb-4 flex space-x-4">
        <input
          type="text"
          placeholder="Buscar por RUT"
          value={rutBusqueda}
          onChange={(e) => setRutBusqueda(e.target.value)}
          className="border rounded p-2"
        />
        <select
          value={proveedorSeleccionado}
          onChange={(e) => setProveedorSeleccionado(e.target.value)}
          className="border rounded p-2"
        >
          <option value="">Todos los proveedores</option>
          {proveedores.map((p) => (
            <option key={p.id} value={p.rut}>{p.nombre}</option>
          ))}
        </select>
        <button type="submit" className="bg-blue-600 text-white px-4 py-2 rounded">
          Buscar
        </button>
      </form>

      <table className="min-w-full bg-white shadow rounded">
        <thead>
          <tr className="bg-gray-100">
            <th className="text-left p-3">ID</th>
            <th className="text-left p-3">Folio</th>
            <th className="text-left p-3">Fecha Emisión</th>
            <th className="text-left p-3">Monto Total</th>
            <th className="text-left p-3">Proveedor</th>
            <th className="text-left p-3">Acciones</th>
          </tr>
        </thead>
        <tbody>
          {facturas.map((factura) => (
            <tr key={factura.id} className="border-t">
              <td className="p-3">{factura.id}</td>
              <td className="p-3">{factura.folio}</td>
              <td className="p-3">{factura.fecha_emision}</td>
              <td className="p-3">${factura.monto_total.toFixed(2)}</td>
              <td className="p-3">{factura.proveedor?.nombre}</td>
              <td className="p-3">
                <Link to={`/facturas/${factura.id}`} className="text-blue-600 hover:underline">
                  Ver Detalles
                </Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
